import React from 'react';
import Heart from '../assets/decor/heart.png'

function Card(props){
    var character = props.student;
    const characters = ["Hatman", "Gaz", "Andrew", "Isaak", "Simon", "YiSeul", "Owen", "Rei", "August", "Avery", "Ami", "Mai", "Camille", "Yumeji", "Jones", "Empty", "V", "Emma"];
    var index = characters.indexOf(character)+1;
    return(
        <div id="idcard">
            <div id="idfront">
                <div id="idheader">
                    <img id="idlogo" src={Heart} alt=""></img>
                    <h1>username goes here</h1>
                </div>
                <div id="iddata">
                    <div id="portrait-background">
                        
                    </div>
                </div>
                <div id="idfooter">
                    
                </div>
            </div>
            <div id="idback">
                <div id="bioheader"><h1>PUBLIC BIO</h1></div>
                <div id="bio"></div>
            </div>
        </div>
    )
} export default Card;
